import { IonPage, IonHeader, IonToolbar, IonTitle } from "@ionic/react";
import React from "react";
import { User } from "../models/Other/User";

class UserProfile extends React.Component<any> {

  state = {
    user: User
  }

  constructor(props: any) {
    super(props);
    this.state = {
      user: this.props.user
    };
  }

  componentDidMount() {
    console.log("In UserProfile got: ");
    console.log(this.props.user);
  }

  render() {

    return(
      <IonPage>

            <IonHeader>
                <IonToolbar color="primary">
                  <IonTitle id="page-title">My profile</IonTitle>
                </IonToolbar>
            </IonHeader>


        </IonPage>
    );
  }
}

/*
<IonContent class="background-image"></IonContent>
*/

export default UserProfile;

const Avaliacoes: React.FC = () => {
  return(
    <IonPage>

          <IonHeader>
              <IonToolbar color="primary">
                <IonTitle id="page-title">Avaliacoes</IonTitle>
              </IonToolbar>
          </IonHeader>


      </IonPage>
  );
}


export {Avaliacoes};
